import { RenameDataSourceViewModel } from './_rename-data-source-viewmodel';
export class RenameDataSourcePopup {
    constructor(dataSourceBrowser) {
        this._viewModel = new RenameDataSourceViewModel(dataSourceBrowser);
        this.template = {
            name: 'dx-dashboard-datasources-rename-popup',
            data: this._viewModel
        };
    }
    show(dataSource) {
        this._viewModel.show(dataSource);
    }
}
